          <img src="#"></img>
          <h1>PretVA</h1>
          <p>making fashion easy</p>
        </div>
      </div>
      <div className="navigation_section">
        <div className="nav_bar">
          <ul>
            <li></li>
          </ul>
        </div>
      </div>
      <div className="user_section"></div>
    </section>
  );
}

export default Header;
